  getProducts().then(response => {
    console.log(response.data);
  }).catch(error => {
    console.error("Error fetching products:", error);
  });
  }, []);
  return (
    <div className="appcontainer">
     {
      products.map((product) => (
        <ProductCard 
          key={product.id}
          name={product.name}
          desc={product.description}
          img={product.image}
          ratings={product.ratings}
          stock={product.stock}
          price={product.price}
        />
        ))
     }
    </div>
  )
}

export default App
